pragma solidity ^0.5.0;

contract collegeRating{

  struct ratingStruct{
          uint[] deptId;
          mapping(uint => uint) rating;
          uint avgRating;

        }  

  mapping (address => ratingStruct) collageRating;

  function setRating(address _collegeId, uint _deptId, uint _rating)
     public {

       collageRating[_collegeId].deptId.push(_deptId);
       collageRating[_collegeId].rating[_deptId] = _rating;

     }


    function getRating(address _collegeId, uint _deptId)
     public view returns(uint){
     return collageRating[_collegeId].rating[_deptId] ;

     }

}
